import React, { useState } from "react";
import IngredientSelector from "y/components/features/ingredientsSelector";
import TagSelector from "y/components/features/tagSelector";
import { type RecipeInput } from "y/server/api/routers/recipes";
import { api } from "y/utils/api";
// import { useRouter } from "next/navigation";
import { Units } from "y/index.d";
import UploadImage from "y/components/features/uploadImage";

const CreateRecipe: React.FC = () => {
  const { mutate } = api.recipe.createRecipe.useMutation();
  // const { push } = useRouter();

  const [recipe, setRecipe] = useState<RecipeInput>({
    title: defaultTitle,
    ingredients: [],
    description: defaultDirections,
    yieldValue: defaultYeild,
    directions: defaultDescription,
    image: "",
    tags: [],
  });

  const handleSubmit = () => {
    try {
      const newRecipe = mutate(recipe);
      console.log("New recipe created:", newRecipe);
      // push("/");
    } catch (error) {
      console.error("Failed to create recipe:", error);
    }
  };

  const handleIngredientChange = (
    index: number,
    name: string,
    amount: number,
    unit: Units
  ) => {
    console.log("invoked handleIngredientsChange", {
      index,
      name,
      amount,
      unit,
    });
    const newIngredients = [...recipe.ingredients];
    newIngredients[index] = { name, amount, unit };
    setRecipe({ ...recipe, ingredients: newIngredients });
  };

  const handleTagChange = (index: number, tag: { name: string }) => {
    const newTags = [...recipe.tags];
    newTags[index] = tag;
    setRecipe({ ...recipe, tags: newTags });
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="mb-6 text-2xl">Create a new recipe</h1>
      <div className="card bordered">
        <div className="card-body">
          <div className="form-control">
            <label className="label">
              <span className="label-text">Title</span>
            </label>
            <input
              type="text"
              className="input-bordered input"
              value={recipe.title}
              onChange={(e) => setRecipe({ ...recipe, title: e.target.value })}
            />
          </div>

          <div className="form-control">
            <label className="label">
              <span className="label-text">Description</span>
            </label>
            <textarea
              className="textarea-bordered textarea"
              value={recipe.description}
              onChange={(e) =>
                setRecipe({ ...recipe, description: e.target.value })
              }
            ></textarea>
          </div>

          <div className="form-control">
            <label className="label">
              <span className="label-text">Yield</span>
            </label>
            <input
              type="number"
              className="input-bordered input"
              value={recipe.yieldValue}
              onChange={(e) =>
                setRecipe({ ...recipe, yieldValue: Number(e.target.value) })
              }
            />
          </div>

          <div className="form-control">
            <label className="label">
              <span className="label-text">Image URL</span>
            </label>
            <UploadImage
              onImageUploaded={(base64Image) =>
                setRecipe({ ...recipe, image: base64Image })
              }
            />
            {recipe.image && (
              <div className="mt-4">
                <img src={recipe.image} />
              </div>
            )}
          </div>

          <div className="form-control">
            <label className="label">
              <span className="label-text">Directions</span>
            </label>
            <textarea
              className="textarea-bordered textarea"
              value={recipe.directions}
              onChange={(e) =>
                setRecipe({ ...recipe, directions: e.target.value })
              }
            ></textarea>
          </div>

          <div className="form-control">
            <label className="label">
              <span className="label-text">Ingredients</span>
            </label>
            {recipe.ingredients.map((ingredient, index) => (
              <div key={index} className="mb-1">
                <IngredientSelector
                  optionsToHide={recipe.ingredients.map(
                    (ingredient) => ingredient.name
                  )}
                  onSelect={(name, amount, unit) =>
                    handleIngredientChange(index, name, amount, unit)
                  }
                  initialAmount={ingredient.amount}
                  initialUnit={Units.CUP}
                />
              </div>
            ))}
            <button
              className="btn-primary btn-sm btn mt-2"
              onClick={() =>
                setRecipe({
                  ...recipe,
                  ingredients: [
                    ...recipe.ingredients,
                    { amount: 0, name: "", unit: Units.CUP },
                  ],
                })
              }
            >
              Add Ingredient
            </button>
          </div>

          <div className="form-control">
            <label className="label">
              <span className="label-text">Tags</span>
            </label>
            {recipe.tags.map((_tag, index) => (
              <div key={index} className="mb-1">
                <TagSelector
                  optionsToHide={recipe.tags.map((tag) => tag.name)}
                  freeSolo
                  onSelect={(value: string | string[]) => {
                    if (!Array.isArray(value)) {
                      handleTagChange(index, { name: value });
                    }
                  }}
                />
              </div>
            ))}
            <button
              className="btn-primary btn-sm btn mt-2"
              onClick={() =>
                setRecipe({ ...recipe, tags: [...recipe.tags, { name: "" }] })
              }
            >
              Add Tag
            </button>
          </div>

          <div className="form-control mt-4">
            <button className="btn-primary btn" onClick={handleSubmit}>
              Create Recipe
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CreateRecipe;

//region
const defaultTitle = "testName";
const defaultYeild = 4;
const defaultDescription = "sfdc";
const defaultDirections = "fseadc";
const defaultImage =
  "data:image/jpeg;base64,";
//regionend
